import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { Navbar } from '../../components';

export default class Test extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <>
        <Navbar />
        <div>
            <Link to="/">Esse não atualiza a página</Link>
        </div>
      </>
    );
  }
}
